import React from "react";

const Modal = ({ titulo, cerrar, children }) => {
  return (
    <div className="-ml-4 -mt-4 flex w-screen h-screen absolute bg-gray-400 bg-opacity-80">
      <div className=" bg-white  w-auto m-auto opacity-100  ">
        <div className="bg-blue-primary flex flex-row justify-between text-white p-3">
          <h3 className="self-end">{titulo}</h3>
          <button className="hover:text-red-700" onClick={cerrar}>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="h-6 w-6"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M6 18L18 6M6 6l12 12"
              />
            </svg>
          </button>
        </div>
        <div>{children}</div>
      </div>
    </div>
  );
};

export default Modal;
